import { Button, Col, Row } from 'antd';
import React from 'react'
import { TransformWrapper, TransformComponent } from "react-zoom-pan-pinch";
import TreeOffice from "../TreeOffice/TreeOffice";
import { FiZoomIn, FiZoomOut } from "react-icons/fi";
import './Zoom.scss'

export default function Zoom() {
    return (
     

      // <TransformWrapper>
      //   <TransformComponent>
      //     <TreeOffice/>
      //   </TransformComponent>
      // </TransformWrapper>

            <TransformWrapper className="zoom"
        initialScale={0.5}
        minScale={0.3}
        maxScale={1.2}
        initialPositionX={-200}
        centerContent={true}
        wheelEnabled={false}
        
      >
        {({ zoomIn, zoomOut, resetTransform, ...rest }) => (
          <React.Fragment>
            <div className="tools">
              <Row>
                <Col span={24}>
                <Button className="secondary" onClick={() => zoomIn()} icon={<FiZoomIn />} size="middle" /></Col>
              </Row>
              <Row>
                <Col span={24}><Button onClick={() => zoomOut()} icon={<FiZoomOut />} size="middle"></Button></Col>
              </Row>
            </div>
            <TransformComponent  >
              <TreeOffice/>
            </TransformComponent>
          </React.Fragment>
        )}
      </TransformWrapper>
       
    )
}
